import React from 'react'
import Targets from '../Components/Targets'
import FlipMove from 'react-flip-move';

const Grid = ({targets}) => (
    <FlipMove>
        {targets.map(target => <Targets handleClick={props.handleClick} key={target.id}{...target}/>)}
    </FlipMove>
);
export default Grid
